import React, {useState, useEffect} from 'react'

const Home = () => {
    const [message, setMessage] = useState('loading...');

    useEffect(() => {
        fetch('http://localhost:3000/api')
        .then(res => res.text())
        .then(text => {
            setMessage(text);
        });
    }, [])


    return (
        <div>
            <h1>Home</h1>
            <p>{message}</p>
        </div>
    )
}

export default Home
